    {"id": "2", "name" : "Naveen", "age" : "34", "location": "Delhi", "number" : "9854984533" },
    {"id": "3", "name" : "Durgesh", "age" : "29", "location": "Noida", "number" : "8850984409" },
    {"id": "4", "name" : "Rahul", "age" : "30", "location": "Faridabad", "number" : "8750988750" }
]
  return (
    <div className="App">
      <h1>New React App</h1>
      <ChangeMessage name="Chandan" />
      <Message />
      {/* <Listing data={data} /> */}
    </div>
  );
}

export default App;
